style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("musica.com") {

  body {
    color: #777;
    background-color: #080808 !important;
  }
   
  table {
    background-color: #222 !important;
  }
  td {
    color: #777;
    background-color: #222 !important;
  }
  
  a:link {
    color: red;
  }

  a:visited {
    color: #C6C6C6;
  }

  a:hover {
    color: hotpink;
  }

  a:active {
    color: blue;
  }
  
}
